    function RenderCalendar(th) {
        switch ($(th).attr("data-vatt")) {
            case "date":
            case "datetime":
            case "DATE":
            case "DATETIME":
                if (!$(th).prop("disabled")) {
                    if ($(th).data("datepicker") !== undefined) {
                        $(th).datetimepicker("destroy")
                    }
                    $(th).removeClass("hasDatepicker");
                    var nm = GetName($(th));
                    $(th).attr("maxlength", "10");
                    if ($(th).attr("data-vatt").toLowerCase() == "datetime") {
                        $(th).datetimepicker({
                            addSliderAccess: true,
                            sliderAccessArgs: {
                                touchonly: false
                            },
                            changeMonth: true,
                            changeYear: true,
                            yearRange: "-100:+10",
                            onSelect: function() {
                                $(this).trigger("keyup");
                                $(this).blur()
                            },
                            beforeShow: function() {
                                setTimeout(function() {
                                    InitializeIframe()
                                }, 100)
                            }
                        })
                    } else {
                        $(th).datetimepicker({
                            showTimepicker: false,
                            addSliderAccess: true,
                            sliderAccessArgs: {
                                touchonly: false
                            },
                            changeMonth: true,
                            changeYear: true,
                            yearRange: "-100:+10",
                            onSelect: function() {
                                $(this).trigger("keyup");
                                $(this).blur()
                            },
                            beforeShow: function() {
                                setTimeout(function() {
                                    InitializeIframe()
                                }, 100)
                            }
                        })
                    }
                }
                break
        }
    }

